					"esES": "Lanzar una habilidad de tormenta aumenta un +30% la probabilidad de golpe crítico de tu siguiente habilidad de hombre lobo.\n\nLanzar una habilidad de tierra aumenta un x45% el daño de golpe crítico de tu siguiente habilidad de hombre oso.",
