					"frFR": "Utiliser une compétence de tempête augmente les chances d'infliger un coup critique de votre prochaine compétence de lycanthrope de +30%.\n\nUtiliser une compétence de terre augmente les dégâts critiques de votre prochaine compétence d'ursoïde de x45%.",
					"itIT": "Lanciare un'abilità di tempesta aumenta la probabilità di critico della successiva abilità da Lupo Mannaro del +30%.\n\nLanciare un'abilità di terra aumenta i danni critici della successiva abilità da Orso Mannaro del x45%.",
					"jaJP": "嵐スキルを使用すると、次の人狼スキルのクリティカルヒット率が+30%上昇する。\n\n土スキルを使用すると、次の人熊スキルのクリティカルヒットダメージがx45%増加する。",
					"koKR": "폭풍 기술을 시전하면 다음 늑대인간 기술의 극대화 확률이 +30% 증가합니다.\n\n대지 기술을 시전하면 다음 곰인간 기술의 극대화 피해가 x45% 증가합니다.",
					"plPL": "Użycie umiejętności Burzy zwiększa szansę na trafienie krytyczne kolejnej umiejętności Wilkołaka o +30%.\n\nUżycie umiejętności Ziemi zwiększa obrażenia od trafienia krytycznego kolejną umiejętnością Niedźwiedziołaka o x45%.",
					"ptBR": "Lançar uma habilidade de Tempestade aumenta a chance de acerto crítico da sua próxima habilidade de Lobisomem em +30%.\n\nLançar uma habilidade de Terra aumenta o dano de acerto crítico da sua próxima habilidade de Urso em 45%.",
