					"ruRU": "\"Огненный шар\" и \"Метеорит\" повышают вероятность критического удара того же умения на +5% на 5 сек. вплоть до +15%. Новые эффекты не обновляют время действия уже полученных.\n\nTags: Critical Strikes.",
